      type: System.String
      description: The key of the object to add to the dictionary.
    - id: value
      type: System.Object
      description: The object to add to the dictionary.
    return:
      type: System.Boolean
      description: <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/builtin-types/bool">true</a> if the value was added successfully, <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/builtin-types/bool">false</a> otherwise.
